import React from 'react'
import './features.css';

const Features = () => {
  return (
    <div className="gpt3__features section__padding" id="features">
      <div className="got3__features-heading">
        <h1 className="gradient__text">The Future is Now and You Just Need To Realise It. Step into the Future today & make it happen</h1>
      </div>
    </div>
  )
}

export default Features
